import {LedgerDetail} from "./LedgerDetail";

export class Ledger {
    totalAmount: number
    totalAmountInCurrency: string
    currencyRates: Map<string, Map<string, number>>
    ledgerDetails: LedgerDetail[]

    constructor(totalAmount: number, totalAmountInCurrency: string, currencyRates: Map<string, Map<string, number>>, ledgerDetails: LedgerDetail[]) {
        this.totalAmount = totalAmount;
        this.totalAmountInCurrency = totalAmountInCurrency;
        this.currencyRates = currencyRates;
        this.ledgerDetails = ledgerDetails;
    }
}
